  return (
    <div className="Ariana Grande Store">
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">
          <img
            alt=""
            src="white-heart.png"
            width="30"
            height="30"
            className="d-inline-block align-top"
          />{' '}
          Ariana Grande Shop
        </Navbar.Brand>
      </Navbar>
    </div>
  );
}

export default App;
